import Todo from '/Users/lauren/Flatiron/note-taker-fe/src/components/Todo.js'
import TodoForm from './TodoForm'


export default function TodoIndex({todos}) {

    const handleEdit = (todoToEdit) => {
        <TodoForm todoToEdit={todoToEdit} />
    }

    return (
        <div>
            {todos.map(todo => 
                <Todo key={todo.id} todo={todo} editTodo={handleEdit}/>
            )}
        </div>
    )
}
